  return (
    <Aside>
      <label>Categor√≠as</label>
      <select>
        <option></option>
        {categorias?.map((e) => {
          return <option>{e.name}</option>;
        })}
      </select>

      <label>Provincias</label>
      <select>
        <option></option>
        {provincias?.map((e) => {
          return <option>{e.name}</option>;
        })}
      </select>
    </Aside>
  );
}

export default Categorias;
